import React from "react";
import { Text, StyleSheet, View} from "react-native";



const BoxScreen = () => {
        

    return( 
    <View>
        <Text styles = {styles.textStyle}>Boxs screen</Text>
    </View>
    
    );


};

const styles = StyleSheet.create({

    SubheaderStyle: {
        fontSize : 20

    },

    textStyle: {
        fontSize: 45

    },

    container: {
        flex: 1,
        padding: 24,
        backgroundColor: "#20232a"
      }

});


export default BoxScreen;
